import React from 'react';
import ReactDOM from 'react-dom';
import fetch from 'node-fetch';

const url = 'https://kodaktor.ru/j/users';
const { users } = fetch(url).then((x) => x.json);
console.log(users);
// const logins = [];
// users.forEach((element) => logins.push(element['login']));
// console.log(logins);

const Person = (prop) => {
  const { login } = prop;
  const stars = '☆' * login.length;
  return (
    <div>
      <strong>
        {login}
      </strong>
      {stars}
    </div>
  );
};
const PersonList = () => {
  const getPerson = (personName) => (
    <Person {...personName} />
  );

  return (
    <div>{users.map((personName) => getPerson(personName))}</div>
  );
};
const App = () => (
  <PersonList />
);

const rootElement = document.getElementById('root');
ReactDOM.render(<App />, rootElement);
